    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvw"); GTEST_ASSERT_EQ(hash->to_string(), "7f07818e14d08944ce145629ca54332f5cfad148c590efbcb5c377f4d336e5f4"); delete hash;
    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwx"); GTEST_ASSERT_EQ(hash->to_string(), "93b0cabf8668e0c534c52a568957499e12a284f59d97dc9b2725ef836804875b"); delete hash;
    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxy"); GTEST_ASSERT_EQ(hash->to_string(), "69b980549d5045969285133df773ae91ddd5d0e5c73dc8ee959b2eb223bc5fbb"); delete hash;
    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz"); GTEST_ASSERT_EQ(hash->to_string(), "71c480df93d6ae2f1efad1447c66c9525e316218cf51fc8d9ed832f2daf18b73"); delete hash;
