    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz123"); GTEST_ASSERT_EQ(hash->to_string(), "2813123a08c26611b20fa0a201695263acdae622a382063583c7c4e18b29f3f5"); delete hash;
    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz1234"); GTEST_ASSERT_EQ(hash->to_string(), "270e309a64bba6e2edc4f0a03c0eb6c2c827f71d02ca45d351f66373d9ead019"); delete hash;
