    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz123456"); GTEST_ASSERT_EQ(hash->to_string(), "f6d527e6d01865481134f29788be2afe7fc3c702e1a55d7ceafac5f35199e8dc"); delete hash;
    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz1234567"); GTEST_ASSERT_EQ(hash->to_string(), "5cb3630d0681f9c1dce6ceb58b182b9a6e45f04efaa7b2eec3b9f2cafa6f65ac"); delete hash;
    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz12345678"); GTEST_ASSERT_EQ(hash->to_string(), "df13770a389790fc959fc73655fcc78ef62181881ede0e4d1475d63ad3dfc963"); delete hash;
