    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz1234567890"); GTEST_ASSERT_EQ(hash->to_string(), "77d721c817f9d216c1fb783bcad9cdc20aaa2427402683f1f75dd6dfbe657470"); delete hash;
    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz1234567890a"); GTEST_ASSERT_EQ(hash->to_string(), "f66533ccd4ff82fb1fe57bc294b840a250b258762c4b222dc884214b508ae7f2"); delete hash;
    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz1234567890ab"); GTEST_ASSERT_EQ(hash->to_string(), "b9ca1d28b2aa83a918a6d0d91c32193227bee59c62c356a0a36e58514b239cef"); delete hash;
    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz1234567890abc"); GTEST_ASSERT_EQ(hash->to_string(), "815f9a799966ed956dfccd6c7eee671c7b1405476c7595a21f1bffdf205e4291"); delete hash;
