    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz1234567890abcdefghijklmno"); GTEST_ASSERT_EQ(hash->to_string(), "29d005663a589c71260205344f9127dad86f40ee7747ca3d06ce568b78634c79"); delete hash;
    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz1234567890abcdefghijklmnop"); GTEST_ASSERT_EQ(hash->to_string(), "03c97550e8babe878ac2ae5061b7dcc2c3252452c4485cf0a4b501f126e29bfa"); delete hash;
    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz1234567890abcdefghijklmnopq"); GTEST_ASSERT_EQ(hash->to_string(), "84b7606efde65e399212890c96f246ced6888d7c1174c94a622973c2e93c1478"); delete hash;
    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz1234567890abcdefghijklmnopqr"); GTEST_ASSERT_EQ(hash->to_string(), "f6ddc70a4f99368d693eccb0a75f3d5c17d03a6a702cbcca838f16697263e836"); delete hash;
    hash = hash::Sha256Algorithm().calculate("abcdefghijklmnopqrstuvwxyz1234567890abcdefghijklmnopqrs"); GTEST_ASSERT_EQ(hash->to_string(), "b8a9488be2dad5dc7cb8e158f4374aec4ce2f0a3fde3deb4d1e0e14d013c98b8"); delete hash;
